import React,  { Component } from 'react';

export default class extends Component {
    render () {
        return (
        <div className="container">
            <div className="title">Hey, got plants tonight?</div>
        <style jsx>
            {`
                .container div {
                    width: 100%;
                    height: 50%;
                    background-image: url("../assets/got-plants-tonight-desktop.jpg");
                    background-size: cover;
                }
                .title {
                    color: black;
                    font-family: 'Ubuntu', sans-serif;
                    font-weight: bold;
                    letter-spacing: 1;
                    font-size: 2em;
                };
            `}
        </style>
        </div>
        )
    }
}
